import React from "react";
import Right from "../img/icon/right.svg"
import { Link } from "react-router-dom";

function index(){
    const slide = document.querySelector('.slide');
    function SlideRight(){
        slide.clientLeft()
    }
    return(
        <div className={"main"}>
            <div className={"slider"}>
                <div className={"slide b"}>
                    <button className={"slider__btn"}><img className={"icon"} src={Right} /></button>
                    <Link to={'/lection'}>
                        <div className="slide__element">Lection</div>
                    </Link>
                </div>
                <div className={"slide r"}>
                    <Link to={'/practice'}>.
                        <div className="slide__element">Practice</div>
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default index;
